Vtiger_List_Js("Calendar_List_Js",{triggerImportAction:function(importUrl){var progressIndicatorElement=jQuery.progressIndicator();AppConnector.request(importUrl).then(function(data){progressIndicatorElement.progressIndicator({mode:"hide"});if(data){app.showModalWindow(data,function(data){jQuery("#ical_import").validationEngine(app.validationEngineOptions)})}})},triggerExportAction:function(exportActionUrl){var progressIndicatorElement=jQuery.progressIndicator();var listInstance=Vtiger_List_Js.getInstance();var selectedIds=listInstance.readSelectedIds(true);var excludedIds=listInstance.readExcludedIds(true);var cvId=listInstance.getCurrentCvId();var pageNumber=jQuery("#pageNumber").val();if("undefined"===typeof cvId){exportActionUrl+="&selected_ids="+selectedIds+"&excluded_ids="+excludedIds+"&page="+pageNumber}else{exportActionUrl+="&selected_ids="+selectedIds+"&excluded_ids="+excludedIds+"&viewname="+cvId+"&page="+pageNumber}var listViewInstance=Vtiger_List_Js.getInstance();if(listViewInstance.getListSearchInstance()){var searchValue=listViewInstance.getListSearchInstance().getAlphabetSearchValue();exportActionUrl+="&search_params="+JSON.stringify(listViewInstance.getListSearchInstance().getListSearchParams());if((typeof searchValue!="undefined")&&(searchValue.length>0)){exportActionUrl+="&search_key="+listViewInstance.getListSearchInstance().getAlphabetSearchField();exportActionUrl+="&search_value="+searchValue;exportActionUrl+="&operator=s"}}AppConnector.request(exportActionUrl).then(function(data){progressIndicatorElement.progressIndicator({mode:"hide"});if(data){app.showModalWindow(data,function(data){})}})}},{});